import React, {Component} from 'react';
import {connect} from 'react-redux';
import {Card, CardHeader, CardFooter, CardBody, Form, FormGroup, Label} from 'reactstrap';
import Datepicker  from 'react-datepicker';
class CreateBill extends Component {
  render() {
    return (
      <Card>
        <CardHeader>
          <strong>Lập Hóa Bán Sản Phẩm</strong>
        </CardHeader>
        <CardBody>
          <Form>
            <FormGroup>
              <Label for={'dateCreated'}>Ngày Tạo</Label>
              <Datepicker dateFormat={'dd/MM/yyyy'} disabled={true}/>
            </FormGroup>
          </Form>
        </CardBody>
        <CardFooter>

        </CardFooter>
      </Card>
    );
  }
}

function mapStateToProps(state) {
  return {};
}

export default connect(
  mapStateToProps,
)(CreateBill);
